    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 NOT BETWEEN + - 47 * - - col1 AND - - ( + + col1 );
  - name: tab2

outputs:
  - name: q11944.out
    data: |
      46	51	23
      64	77	40
      75	67	58
